import http from "../http-common";

const getAll = () => {
  return http.get("/profils");
};

const getAllBlocs = () => {
  return http.get("/profils/getBloc");
};

const getOptionsByBloc = id => {
  return http.get(`profils/options/${id}`);  
};

export default {
  getAll,
  getAllBlocs,
  getOptionsByBloc
};
